import './home.css'
import { init } from 'ityped'
import { useEffect, useRef } from 'react'


export default function Home() {

    const textRef = useRef();

    useEffect(() => {
        init(textRef.current,
            {
                showCursor: false,
                strings: ['Developer', 'Designer', 'Content Creator']
            })

    }, [])

    return (
        <div className='home'>
            <div className="left">
                <div className="img-container">
                    <img className='image' src="../../man.png" alt="" />
                </div>
            </div>
            <div className="right">
                <div className="wrapper">
                    <h3>hi there, i'm</h3>
                    <h1>KHALED ELGAMILY</h1>
                    <h3>freelance <span className='typo' ref={textRef}></span></h3>
                </div>
                <i class="fa-solid fa-arrow-down arr-icon"></i>
            </div>
        </div>
    )
}
